import React, { Component } from 'react';
import { connect } from 'react-redux';
import { loadSurvey } from '../../../action/survey';
class FillSurvey extends Component {
  componentDidMount = () => {
    this.props.loadSurvey('MySecondSeker');
  };
  render() {
    return (
      <div>
        <h3>FILL SURVEY COMPONENT</h3>
      </div>
    );
  }
}

export default connect(null, { loadSurvey })(FillSurvey);
